import Link from 'next/link'

export default function Header() {
  return (
    <div className="header">
      <div className="home-nav">
        <Link  href="/">
          <h1>Interviewing in Python</h1>
        </Link>
      </div>
      <div className="nav-links">
          <Link  href="/experience">
            <a>questions</a>
          </Link>
      </div>
      <style jsx>{`
        .header {
          position: absolute;
          width: 100%;
          height: 100px;
          background: #FFFFFF;
          box-shadow: 0px 1px 0px rgba(0, 0, 0, 0.25);
        }

        .home-nav {
          list-style: none;
        }

        .title {
          position: absolute;
          left: 5.58%;
          right: 72.97%;
          top: 10.77%;
          bottom: 28.85%;

          font-family: Roboto;
          font-style: normal;
          font-weight: normal;
          font-size: 18px;
          line-height: 21px;

          color: #000000;
        }

        .questions {
          position: absolute;
          left: 57.82%;
          right: 35.64%;
          top: 36.54%;
          bottom: 36.54%;

          font-family: Roboto;
          font-size: 12px;
          line-height: 14px;

          color: rgba(0, 0, 0, 0.6);
        }

        a {
          padding: 0 10px;
          text-decoration: none;
          font-size: 16px;
          color: #666;
          font-family: Sans-Serif;
        }
      `}</style>
    </div>
  )
}
